import React from "react";

const Hoc = () =>{
    return(
        <>
            <Ch cr={Main}/>
        </>
    )
}

const Ch = (props) =>{
    return(
        <>
            <div style={{color:'#ff0000'}}><props.cr/></div>
        </>
    )
}

const Main = () =>{
    return(
        <>
            <h2>raushan</h2>
            <p>raushan</p>
        </>
    )
}

export default Hoc;
